(82, 4, '无上神帝', 'Supreme God Emperor', 'wushangshendi', 'wushangshendi', 'https://banana.xpornkit.com/upload/covers/2025/12/29/7c599f33a14995ce0558449cc410f3e2.jpg', '', '溪林', '项方', '', '2020', '中国大陆', '普通话', 0.0, 0, 0, 0, 0, 0, 0, '第556集', '万年之前，仙王牧云因持有诛仙图而遭人暗算，残魂沉睡万年之后，在天运大陆南云帝国有名的“废物牧云”身上觉醒。牧云初醒，就受到了学生妙仙语的刻意刁难，牧云轻松的就化解了妙仙语的陷阱，并举一反三的说出了更多的炼丹技巧，让门外的炼丹大师莫问赏识不已。回到家中，牧云得知了要与秦家小姐秦梦瑶结亲的消息。秦梦瑶寒毒在身，活不过二十岁，结亲不过是为了牧家和秦家的利益。但牧林辰的劝说下，牧云以炼丹为条件，答应了这门亲事。炼出了淬骨丹，牧云的修为有了第一次提升。莫问时常来找牧云请教，而秦时雨一直想请莫问来治疗孙女秦梦瑶。莫问暗示让牧云一试，牧云阴差阳错下唤醒了体内的诛仙图，得知秦梦瑶体内的并非寒毒，而是冰凰神魄。牧云治好了秦梦瑶，冰凰神魄的力量使得秦梦瑶修为突飞猛进。在见识到了牧云的能力后，秦梦瑶对牧云充满了好奇和兴趣，于是成为了北云学院的导师，和牧云教导同一个班级。而追求秦梦瑶不成的东方玉，嫉妒仇恨之心燃起，誓与牧云势不两立。牧云借着诛仙图突破修为，去北云山脉历练，妙仙语执意同行，途中牧云以一人之力猎杀十几头紫毛猎狼，让妙仙语十分震惊。而被人指派暗杀幕运动柳山四煞一路尾随，趁牧云脱力之机会，纷纷现身准备对牧云下手。', 'gsyun$$$gsm3u8', '第01集$https://v.gsuus.com/play/9avOXX8b#第02集$https://v.gsuus.com/play/xboM3Keg#第03集$https://v.gsuus.com/play/9avWnrbG#第04集$https://v.gsuus.com/play/xboM3zeg#第05集$https://v.gsuus.com/play/kaz1rreJ#第06集$https://v.gsuus.com/play/wdLQQgej#第07集$https://v.gsuus.com/play/NbW55Wey#第08集$https://v.gsuus.com/play/7e5mmxe2#第09集$https://v.gsuus.com/play/mbkGGxbz#第10集$https://v.gsuus.com/play/xboMMzeg#第11集$https://v.gsuus.com/play/kaz11reJ#第12集$https://v.gsuus.com/play/wdLQLgej#第13集$https://v.gsuus.com/play/NbW5ZWey#第14集$https://v.gsuus.com/play/Qe1g23bJ#第15集$https://v.gsuus.com/play/Pe9qlPeL#第16集$https://v.gsuus.com/play/xboMDzeg#第17集$https://v.gsuus.com/play/9avWNVbG#第18集$https://v.gsuus.com/play/xboMDNeg#第19集$https://v.gsuus.com/play/9avWOgbG#第20集$https://v.gsuus.com/play/oeEJDKa0#第21集$https://v.gsuus.com/play/wdLQNWej#第22集$https://v.gsuus.com/play/NbW52Xey#第23集$https://v.gsuus.com/play/Qe1g5obJ#第24集$https://v.gsuus.com/play/Pe9qn4eL#第25集$https://v.gsuus.com/play/xboMENeg#第26集$https://v.gsuus.com/play/9avWXgbG#第27集$https://v.gsuus.com/play/oeEJNKa0#第28集$https://v.gsuus.com/play/wdLQXWej#第29集$https://v.gsuus.com/play/NbW5gXey#第30集$https://v.gsuus.com/play/Qe1gmobJ#第31集$https://v.gsuus.com/play/7e5mqZe2#第32集$https://v.gsuus.