(83, 4, '逆天至尊', 'Against the sky Supreme / N.T.Z.Z', 'nitianzhizun', 'nitianzhizun', 'https://banana.xpornkit.com/upload/covers/2025/12/29/ccd3202feabfb90397fbd964f4be0b98.jpg', '', '阿旦,糖醋里脊,诗福', '高峰', '', '2021', '内地', '普通话', 0.0, 0, 0, 0, 0, 0, 0, '第475集', '整个宇宙分为域内宇宙和域外宇宙，两个宇宙彼此为敌，域外宇宙由天魔统治，域内宇宙分为神界，仙界，凡间。在宇宙中，像天罚大陆这样的凡间位面，数不胜数，其统称为：九天星域。九天星域中，九大仙帝统领九重之中所有星域。九天之上，乃炼仙神域，仙人最终化神之路，必要通过炼仙神域，方能凝聚神格，成为神，到达神界。神界万族林立，各族之神极为强大。在遥远的过去，神界万族，被始源至尊、混沌至尊，还有鸿蒙至尊统领。三大至尊，三足鼎立，统管神界、九天仙界。鸿蒙神界之主鸿蒙至尊，身份尊贵，属下众多，为神界最强之人，精通天下万术。彼', 'gsyun$$$gsm3u8', '第01集$https://v.gsuus.com/play/Pe987y3d#第02集$https://v.gsuus.com/play/mbk5VlXe#第03集$https://v.gsuus.com/play/xboY90Ke#第04集$https://v.gsuus.com/play/9avg7zrb#第05集$https://v.gsuus.com/play/kazmNE8e#第06集$https://v.gsuus.com/play/oeEl72kd#第07集$https://v.gsuus.com/play/wdLgl24b#第08集$https://v.gsuus.com/play/ZdP1p9ne#第09集$https://v.gsuus.com/play/NbWnzlga#第10集$https://v.gsuus.com/play/Qe1jzDja#第11集$https://v.gsuus.com/play/7e58EgRd#第12集$https://v.gsuus.com/play/Pe987m3d#第13集$https://v.gsuus.com/play/mbk5VPXe#第14集$https://v.gsuus.com/play/xboY9PKe#第15集$https://v.gsuus.com/play/9avg7krb#第16集$https://v.gsuus.com/play/mbk5VPxe#第17集$https://v.gsuus.com/play/xboY9Pze#第18集$https://v.gsuus.com/play/9avg7kVb#第19集$https://v.gsuus.com/play/kazmNore#第20集$https://v.gsuus.com/play/oeEl7BNd#第21集$https://v.gsuus.com/play/wdLglwgb#第22集$https://v.gsuus.com/play/ZdP1pAze#第23集$https://v.gsuus.com/play/NbWnzXWa#第24集$https://v.gsuus.com/play/Qe1jzP3a#第25集$https://v.gsuus.com/play/7e58EXxd#第26集$https://v.gsuus.com/play/Pe987PPd#第27集$https://v.gsuus.com/play/mbk5VNxe#第28集$https://v.gsuus.com/play/xboY9kze#第29集$https://v.gsuus.com/play/9avg7rVb#第30集$https://v.gsuus.com/play/kazmNyre#第31集$https://v.gsuus.com/play/oeEl7mNd#第32集$https://v.gsuus.com/play/wdLglzgb#第33集$https://v.gsuus.com/play/ZdP1pEze#第34集$https://v.gsuus.com/play/NbWnz0Wa#第35集$https://v.gsuus.com/play/Qe1jzN3a#第36集$https://v.gsuus.com/play/7e58E4xd#第37集$https://v.gsuus.com/play/Pe987NPd#第38集$https://v.gsuus.