(88, 21, '鬼灭之刃：无限城篇第一章猗窝座再袭剧场版', '鬼灭之刃 剧场版 无限城篇 第一章 猗窝座再来 / Demon Slayer: Kimetsu no Yaiba Infinity Castle / Demon Slayer -Kimetsu no Yaiba- The Movie: Infinity Castle', 'guimiezhirenwuxianchengpiandiyizhangyiwozuozaixijuchangban', 'guimiezhirenwuxianchengpiandiyizhangyiwozuozaixijuchangban', 'https://banana.xpornkit.com/upload/covers/2025/12/29/929f5903c0bd8a1df92bc1f48d79467e.jpg', '', '花江夏树,鬼头明里,下野纮,松冈祯丞,上田丽奈,冈本信彦,樱井孝宏,小西克幸,河西健吾,早见沙织,花泽香菜,铃村健一,关智一,杉田智和,宫野真守,石田彰,细谷佳正', '近藤光,外崎春雄', '', '2025', '日本', '日语', 8.6, 0, 0, 0, 0, 0, 0, '正片', '为了让变成鬼的妹妹祢豆子重新变回人类，灶门炭治郎加入了猎鬼组织“鬼杀队”，与同伴我妻善逸、嘴平伊之助一同对抗各类恶鬼，在成长的过程中彼此间的友情与羁绊也日益加深。此后，炭治郎与“鬼杀队”中最高级别的剑士“柱”们数次并肩作战。为备战即将到来的决战，炭治郎正与队员们一同挑战由“柱”们主持的联合强化训练时，鬼舞辻无惨突然现身于产屋敷宅邸。炭治郎与众“柱”虽为解救身处危机的主公大人而火速赶到，却遭无惨之手打入了一个神秘空间。炭治郎等人坠落之处，正是鬼的大本营“无限城”——“鬼杀队”与“鬼”的决战，就此拉开序幕。', 'gsyun$$$gsm3u8', '正片$https://v.gsuus.com/play/e733Dore$$$正片$https://v.gsuus.com/play/e733Dore/index.m3u8', '', NULL, 1, 1766998894, 1766998894),
