(94, 21, '蜡笔小新：灼热的春日部舞者们（印度版）', '蜡笔小新：灼热的春日部舞者 / 蜡笔小新 超华丽！灼热的春日部舞者 / 电影蜡笔小新：超华丽！灼热的春日部舞者们(台) / 蜡笔小新剧场版：超华丽！灼热的春日部舞者(港) / Crayon Shin-chan the Movie: Super Hot! The Spicy Kasukabe Dancers', 'labixiaoxinzhuoredechunribuwuzhemenyinduban', 'labixiaoxinzhuoredechunribuwuzhemenyinduban', 'https://banana.xpornkit.com/upload/covers/2025/12/29/c7106a934fba990d2a3b7c3070ce0c57.jpg', '', '小林由美子,楢桥美纪,森川智之,兴梠里美,真柴摩利,林玉绪,一龙斋贞友,山寺宏一,濑户麻沙美,速水奖,贺来贤人,日高范子,宝龟克寿,坂本千夏,小峠英二,西村瑞樹', '桥本昌和', '', '2025', '日本', '日语', 7.3, 0, 0, 0, 0, 0, 0, '抢先版', '春日部防卫队在“春日部儿童娱乐节”舞蹈比赛中，获得胜利，他们因此得到了前往印度的机会。在尽情享受印度旅游的过程中，小新和阿呆进入了一家神秘的杂货店，在那里发现了一个形状像“鼻子”的背包并买下了它。然而，这个背包隐藏着一个非常可怕的秘密。', 'gsyun$$$gsm3u8', '抢先版$https://v.gsuus.com/play/e5yyA2Ke$$$抢先版$https://v.gsuus.com/play/e5yyA2Ke/index.m3u8', '', NULL, 1, 1766998896, 1766998896),
(95, 4, '龙魂', '龙神万相之龙魂 / The Dragon Spirit', 'longhun', 'longhun', 'https://banana.xpornkit.com/upload/covers/2025/12/29/7023672d5b77efc747856ea97bec20a2.jpg', '', '', '', '', '2025', '中国大陆', '汉语普通话', 0.0, 0, 0, 0, 0, 0, 0, '第08集完结', '千万年来，古老而神秘的龙族在中土大陆繁衍生息。然而，神界的光魂与暗魂之争，也将龙族牵连其中。龙族陷入残酷的内乱，甚至面临灭族之危。绝望时刻，出走已久的东海王子敖雪强势归来，欲解救龙族于危难之中。', 'gsyun$$$gsm3u8', '第01集$https://v.gsuus.com/play/bYEpxzYb#第02集$https://v.gsuus.com/play/dJ6DA4yd#第03集$https://v.gsuus.com/play/e9r6MQYa#第04集$https://v.gsuus.com/play/eZ6O2Zwe#第05集$https://v.gsuus.com/play/dR668D0d#第06集$https://v.gsuus.com/play/bkRR6NYa#第07集$https://v.gsuus.com/play/e733D2Ge#第08集完结$https://v.gsuus.com/play/e1wwVPob$$$第01集$https://v.gsuus.com/play/bYEpxzYb/index.m3u8#第02集$https://v.gsuus.com/play/dJ6DA4yd/index.m3u8#第03集$https://v.gsuus.com/play/e9r6MQYa/index.m3u8#第04集$https://v.gsuus.com/play/eZ6O2Zwe/index.m3u8#第05集$https://v.gsuus.com/play/dR668D0d/index.m3u8#第06集$https://v.gsuus.com/play/bkRR6NYa/index.m3u8#第07集$https://v.gsuus.com/play/e733D2Ge/index.m3u8#第08集完结$https://v.gsuus.com/play/e1wwVPob/index.m3u8', '', NULL, 1, 1766998896, 1766998896),
